INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (130401, "ナーナ", "2024/06/22 14:59:59", -470.0, 2, 10015, 4, 0.0, "2024/03/15 15:00:00", 2002, 1, 0.0, 2, "いらっしゃいませ～♪\nきゃらばんこいん？を\n交換できるんだってー");
