INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (135902, "サツキ", "2025/09/23 14:59:59", -470.0, 6, 10035, 9, 0.0, "2025/06/16 15:00:00", 2002, 2, 4.935, 1, "宵越しの銭を持つような\n野暮いマネぁしくさんな\nツキが落ちてもしらねぇぜ");
