INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (137701, "ヴォルガーノ", "2025/12/22 14:59:59", -470.0, 1, 10040, 10, 0.0, "2025/09/16 15:00:00", 2002, 1, 5.549, 2, "よぅ！　今日の俺さまは\n門番じゃなく、店番だぜ\nメモピ～スフィア～てな！");
