INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (132801, "ライラエル", "2026/03/23 11:59:59", -470.0, 4, 10042, 11, 0.0, "2025/12/15 15:00:00", 2002, 1, 7.642, 7, "こ、この格好は…ヴルムが\n集客効果があると言って…\n…本当でしょうか？");
